                {/* Comenta temporalmente las rutas de componentes faltantes */}
                {/* <Route path="/usuarios/inquilinos" element={<UsuariosInquilinos />} /> */}
                {/* ... */}
            </Routes>
            {/* ... */}
        </Router>
    );
}
